function List() {
    const[data,setData] = useState([])
  return (
    <div>
      
      {
        data.map((item,i)=>(
            <div>
<input type= 'checkbox'/><td key = {i}>{item}</td>
</div>
        ))
      }
    </div>
  )
}

export default List;
